INSERT INTO `sources` (`source_id`, `type_id`, `name`, `weight`, `life`, `variables`) VALUES
(1, 4, 'Major City Contested', 70, 60, 'Headline creator that looks for a contested city that has more than 20 facilities in it. \r\n\r\nVariables:\r\n\r\nCON_CITY\r\nCOUNTRY\r\nCOUNTRY_ADJ\r\nSIDE\r\n'),
(2, 5, 'Best Recent Sortie', 40, 60, 'Creates content based on the best sortie in the last 500 number of sorties. \r\n\r\nVariables:\r\n\r\nPLAYER = player''s callsign\r\nRTB = "Return to Base", "Rescued", "Missing in Action", "Killed in Action"\r\nKILLS = number of kills\r\nHITS = number of vehicle hits\r\nDURATION\r\nCAPTURED'),
(3, 1, 'RDP Intro', 80, 180, 'Produces content based on an RDP Introduction rule. \r\n\r\nVariables:\r\n\r\nVEHICLE\r\nCLASS\r\nCATEGORY\r\nBRANCH\r\nSTART_QUANTITY\r\nSTART_ADJ'),
(4, 1, 'RDP Removal', 50, 180, 'Produces content based on an RDP Removal rule. \r\n\r\nVariables:\r\n\r\nVEHICLE\r\nCLASS\r\nCATEGORY\r\nBRANCH'),
(5, 1, 'RDP Phase Out', 40, 180, 'Produces content based on an RDP Phase Out rule.\r\n\r\nVariables:\r\n\r\nVEHICLE\r\nCLASS\r\nCATEGORY\r\nBRANCH'),
(6, 1, 'RDP Increase', 60, 180, 'Produces content based on an RDP Increase rule. \r\n\r\nVariables:\r\n\r\nVEHICLE\r\nCLASS\r\nCATEGORY\r\nBRANCH\r\nQUANTITY_INCREASE\r\nPERCENTAGE_INCREASE\r\nINCREASE_ADJ'),
(7, 1, 'RDP Decrease', 10, 180, 'Produces content based on an RDP Decrease rule.\r\n\r\nVariables:\r\n\r\nVEHICLE\r\nCLASS\r\nCATEGORY\r\nBRANCH\r\nQUANTITY_DECREASE\r\nPERCENTAGE_DECREASE\r\nDECREASE_ADJ\r\n'),
(8, 1, 'RDP Efficiency', 20, 180, 'Produces content based on an RDP Efficiency Increase rule. \r\n\r\nVariables:\r\n\r\nVEHICLE\r\nCLASS\r\nCATEGORY\r\nBRANCH'),
(9, 6, 'Factory Output Shutdown', 60, 15, 'Attempts to find a factory that has been shutdown.\r\n\r\nVariables:\r\n\r\nFACTORY_CITY\r\nFACTORY_DAMAGE'),
(10, 3, 'Chokepoints Owned', 40, 30, 'Creates content about the percentage control of the current set of Chokepoints by country. \r\n\r\nVariables:\r\n\r\nProduces content about the current makeup of airfield ownerships.\r\n\r\nVariables:\r\n\r\nAXIS_COUNT\r\nALLIED_COUNT\r\nAXIS_PERCENT\r\nALLIED_PERCENT\r\nGERMANY_COUNT\r\nFRANCH_COUNT\r\nENGLAND_COUNT\r\nGERMANY_PERCENT\r\nFRANCH_PERCENT\r\nENGLAND_PERCENT\r\n1ST_COUNT\r\n2ND_COUNT\r\n3RD_COUNT\r\n1ST_PERCENT\r\n2ND_PERCENT\r\n3RD_PERCENT\r\n1ST_COUNTRY\r\n2ND_COUNTRY\r\n3RD_COUNTRY\r\nSUBJECT_COUNT\r\nSUBJECT_PERCENT\r\nSUBJECT_PLACE'),
(11, 2, 'Sortie Averages', 30, 60, 'Creates content about sortie averages over the last 1000 sorties.\r\n\r\nSORTIES_TOTAL\r\nAVERAGE_TIME\r\nAVERAGE_KILLS\r\nAVERAGE_RTB\r\nAVERAGE_RESCUED\r\nAVERAGE_MIA\r\nAVERAGE_KIA\r\nAVERAGE_ATTACK\r\nAVERAGE_DEFENSE\r\nAVERAGE_SUCCESS\r\n'),
(12, 7, 'Spawn Lister', 60, 1440, 'Lists a country''s current spawn list.\r\n\r\nVariables:\r\n\r\nLIST'),
(14, 8, 'RDP Archiver', 50, 720, 'Display alls of the headlines for the next cycles that have already been publicized.\r\n\r\nVariables:\r\n\r\nARCHIVE'),
(16, 12, 'RDP Status', 50, 10, 'Creates content about the status of a side''s current RDP cycle.\r\n\r\nVariables:\r\n\r\nOUTPUT\r\nCOMPLETION\r\nGOAL\r\nPRODUCED\r\nETA'),
(17, 11, 'Factory Health', 50, 10, 'Lists each of a side''s current factories and some information about them.\r\n\r\nVariables:\r\n\r\nFACTORIES'),
(19, 13, 'Server News', 50, 1, '%NEWS%'),
(20, 14, 'Server Status', 50, 1, '%STATUS%'),
(21, 15, 'Pass Through', 30, 60, 'Always allows a story. Doesn''t setup any variables. This source allows things like advertisements, propaganda and rdp stories.'),
(22, 6, 'Factory Output Slowed', 30, 15, 'Produces content about a friendly factory that has been damaged and output is slowed.\r\n\r\nVariables:\r\n\r\nFACTORY_CITY\r\nFACTORY_DAMAGED\r\nFACTORY_OUTPUT'),
(23, 6, 'Factory Captured', 70, 15, 'Produces content about a friendly factory that has been completely captured.\r\n\r\nVariables:\r\n\r\nFACTORY_CITY\r\nCAPTURING_COUNTRY\r\nCAPTURING_COUNTRY_ADJ\r\nCAPTURING_SIDE'),
(24, 6, 'Factory Under Attack', 40, 15, 'Produces content about a factory that is under attack.\r\n\r\nVariables:\r\n\r\nFACTORY_CITY\r\nATTACKING_COUNTRY\r\nATTACKING_COUNTRY_ADJ\r\nATTACKING_SIDE\r\nPERCENT_OWNED\r\nPERCENT_ENEMY\r\nFACTORY_OUTPUT\r\nFACTORY_DAMAGED'),
(25, 4, 'Country Captured', 60, 180, 'Produces content when a country has lost all of its CPs.\r\n\r\nVariables:\r\n\r\nCOUNTRY\r\nCOUNTRY_ADJ\r\nSIDE\r\n'),
(26, 4, 'Country Diminished', 30, 120, 'Produces content about a country that is down to less than 15% ownserhip of all CPs.\r\n\r\nVariables:\r\n\r\nCOUNTRY\r\nCOUNTRY_ADJ\r\nSIDE\r\n'),
(27, 4, 'Country No Factory Output', 40, 120, 'Produces content when a country has no factory output.\r\n\r\nVariables:\r\n\r\nCOUNTRY\r\nCOUNTRY_ADJ\r\nSIDE\r\n'),
(28, 4, 'Major City Sieged', 50, 120, 'Headline creator that looks for a city that is surrounded by enemy cities. \r\n\r\nVariables:\r\n\r\nCITY\r\nCOUNTRY\r\nCOUNTRY_ADJ\r\nSIDE\r\nENEMY_SIDE'),
(29, 4, 'Major City Threatened', 20, 60, 'Headline creator that looks for a major city that has adjacent enemy cities. \r\n\r\nVariables:\r\n\r\nCITY\r\nCOUNTRY\r\nCOUNTRY_ADJ\r\nSIDE\r\nENEMY_SIDE\r\nTHREATS = number of adjacent enemy cities'),
(30, 3, 'Airfields Owned', 50, 120, 'Produces content about the current makeup of airfield ownerships.\r\n\r\nVariables:\r\n\r\nAXIS_COUNT\r\nALLIED_COUNT\r\nAXIS_PERCENT\r\nALLIED_PERCENT\r\nGERMANY_COUNT\r\nFRENCH_COUNT\r\nENGLAND_COUNT\r\nGERMANY_PERCENT\r\nFRENCH_PERCENT\r\nENGLAND_PERCENT\r\n1ST_COUNT\r\n2ND_COUNT\r\n3RD_COUNT\r\n1ST_PERCENT\r\n2ND_PERCENT\r\n3RD_PERCENT\r\n1ST_COUNTRY\r\n2ND_COUNTRY\r\n3RD_COUNTRY\r\nSUBJECT_COUNT\r\nSUBJECT_PERCENT\r\nSUBJECT_PLACE'),
(31, 3, 'Major Cities Owned', 30, 120, 'Creates content about the percentage control of major cities by country. \r\n\r\nVariables:\r\n\r\nProduces content about the current makeup of airfield ownerships.\r\n\r\nVariables:\r\n\r\nAXIS_COUNT\r\nALLIED_COUNT\r\nAXIS_PERCENT\r\nALLIED_PERCENT\r\nGERMANY_COUNT\r\nFRANCH_COUNT\r\nENGLAND_COUNT\r\nGERMANY_PERCENT\r\nFRANCH_PERCENT\r\nENGLAND_PERCENT\r\n1ST_COUNT\r\n2ND_COUNT\r\n3RD_COUNT\r\n1ST_PERCENT\r\n2ND_PERCENT\r\n3RD_PERCENT\r\n1ST_COUNTRY\r\n2ND_COUNTRY\r\n3RD_COUNTRY\r\nSUBJECT_COUNT\r\nSUBJECT_PERCENT\r\nSUBJECT_PLACE'),
(32, 3, 'Offensive Country', 30, 60, 'Produces content about the country with the most open fire bases. \r\n\r\nVariables:\r\n\r\nOFFENSIVE_COUNTRY\r\nOFFENSIVE_COUNTRY_ADJ\r\nOFFENSIVE_SIDE'),
(34, 16, 'RDP Archive Filler', 50, 60, 'This source helps fill in space underneath the RDP Archive story.'),
(35, 17, 'Casualty Reporter', 50, 1440, 'This source produces casualty reports by side.'),
(36, 4, 'Campaign Started', 90, 1440, 'Produces a headline when a campaign starts.'),
(37, 5, 'Recent Promotion', 50, 60, 'Produces content about the recent promotion of a player.\r\n\r\n%PLAYER%\r\n%RANK_BRANCH%\r\n%RANK%\r\n'),
(38, 18, 'Misc', 50, 30, 'Produces miscellaneous content.'),
(39, 4, 'Cycle Started', 80, 180, 'Produces a headline when a country''s cycle starts.'),
(40, 3, 'Front Lines', 50, 60, 'Produces content about the frontlines of a Country.\r\n\r\nAvailable Variables:\r\n\r\n%DISTANCE%\r\n%CHOKEPOINTS%'),
(41, 4, 'Victory Possible', 90, 60, 'Produces Content about a side who is winning...owns 85+% of the CPs.'),
(42, 4, 'Victory Near', 90, 45, 'Produces content about a Side who is close to winning...owns 88+% of the CPs.'),
(43, 4, 'Victory Imminent', 90, 30, 'Produces content about a Side that is about to win...owns 92+% of the CPs.'),
(44, 4, 'Victory', 90, 1440, 'Produces content about a Side that won the map...owns 95+% of the CPs.'),
