(4, 3, 'playnow_axis_german_rdp2.html', '<table border="0" cellspacing="0" cellpadding="5">\r\n<tr align="left" valign="top"> \r\n<td>\r\n<font face="Arial, Helvetica, sans-serif" size="4">\r\n<b>\r\n<span class="paperarialhuge">Tiger to Enter Combat</span>\r\n</b>\r\n</font>\r\n<br>\r\n      <font size="1"> <font face="Arial, Helvetica, sans-serif">\r\n<span class="paperdefault">After months of hard work, German engineers have completed work on the PzKpfw VI E Tank. Army officials at Nettetal were quoted as being quite happy with the new  improved battlefield units being introduced in the field.<br>\r\n<br>\r\nIt is hoped that sufficient numbers will win a  superior combat edge against Allied  forces on the battlefield.\r\n</span>\r\n</font></font> \r\n    </td>\r\n</tr>\r\n</table>', '<table border="0" cellspacing="0" cellpadding="5">\r\n<tr align="left" valign="top"> \r\n<td>\r\n<font face="Arial, Helvetica, sans-serif" size="4">\r\n<b>\r\n<span class="paperarialhuge">%TITLE%</span>\r\n</b>\r\n</font>\r\n<br>\r\n      <font size="1"> <font face="Arial, Helvetica, sans-serif">\r\n<span class="paperdefault">%BODY%</span>\r\n</font></font> \r\n    </td>\r\n</tr>\r\n</table>', 'Pass', 40, 0, '<table border="0" cellspacing="0" cellpadding="5">\r\n<tr align="left" valign="top"> \r\n<td>\r\n<font face="Arial, Helvetica, sans-serif" size="4">\r\n<b>\r\n<span class="paperarialhuge">\r\nFactories Await Orders\r\n</span>\r\n</b>\r\n</font>\r\n<br>\r\n      <font size="1"> <font face="Arial, Helvetica, sans-serif">\r\n<span class="paperdefault">\r\nGerman factories now await new orders and production lists from High Command.\r\n<br><br>\r\nSome are concerned of growing labor shortages in all sectors and the increased reliance on unskilled workers to make up the workforce.\r\n</span>\r\n</font></font> \r\n    </td>\r\n</tr>\r\n</table>', 'False', '2014-02-17 15:23:01'),
(6, 2, 'playnow_allied_stats1.html', '<table border="0" cellspacing="0" cellpadding="5" width="230">\r\n<tr> \r\n<td>\r\n<font size="3" face="Arial, Helvetica, sans-serif">\r\n<b>\r\n<span class="paperarialbig">Germany Push Ahead !</span>\r\n</b>\r\n</font>\r\n<br>\r\n<font face="Arial, Helvetica, sans-serif" size="1">\r\n<span class="paperdefault">German forces pushing further and further into the enemies lines of defense. Axis  combat veterans are increasing the pressure on enemy defenses all across the front lines.\r\n<br><br>\r\nSoldiers, airmen, tankers and naval personel from all branches are showing a commitment and willingness to do what needs to be done that is seeing the war reach its crescendo of destruction in the quest for victory.</span>\r\n</font>\r\n</td>\r\n</tr>\r\n</table>', '<table border="0" cellspacing="0" cellpadding="5" width="230">\r\n<tr> \r\n<td>\r\n<font size="3" face="Arial, Helvetica, sans-serif">\r\n<b>\r\n<span class="paperarialbig">%TITLE%</span>\r\n</b>\r\n</font>\r\n<br>\r\n<font face="Arial, Helvetica, sans-serif" size="1">\r\n<span class="paperdefault">%BODY%</span>\r\n</font>\r\n</td>\r\n</tr>\r\n</table>', 'Pass', 105, 0, '', 'False', '2014-02-17 14:26:02'),
(7, 2, 'playnow_allied_french_rdp1.html', '<table width="189" border="0" cellspacing="0" cellpadding="5">\r\n<tr align="left" valign="top"> \r\n<td>\r\n<font face="Times New Roman, Times, serif" size="3">\r\n<b>\r\n<span class="papertimesbig">France retires the H39!</span>\r\n</b>\r\n</font>\r\n<br>\r\n<font face="Arial, Helvetica, sans-serif" size="1">\r\n<span class="paperdefault">After years of service, the Hotchkiss H39 is being retired from French ground forces. While political reasons were blamed for the decision, quietly officers in the French High Command were quoted as saying they were making room for better armor units. The  more effective units should see action by the end of this production cycle.</span>\r\n</font>\r\n</td>\r\n</tr>\r\n</table>\r\n                                                   ', '<table width="189" border="0" cellspacing="0" cellpadding="5">\r\n<tr align="left" valign="top"> \r\n<td>\r\n<font face="Times New Roman, Times, serif" size="3">\r\n<b>\r\n<span class="papertimesbig">%TITLE%</span>\r\n</b>\r\n</font>\r\n<br>\r\n<font face="Arial, Helvetica, sans-serif" size="1">\r\n<span class="paperdefault">%BODY%</span>\r\n</font>\r\n</td>\r\n</tr>\r\n</table>\r\n                                                   ', 'Pass', 4, 0, '<table width="189" border="0" cellspacing="0" cellpadding="5">\r\n<tr align="left" valign="top"> \r\n<td>\r\n<font face="Times New Roman, Times, serif" size="3">\r\n<b>\r\n<span class="papertimesbig">\r\nFactories Preparing\r\n</span>\r\n</b>\r\n</font>\r\n<br>\r\n<font face="Arial, Helvetica, sans-serif" size="1">\r\n<span class="paperdefault">\r\nFrench industry continues to prepare for new orders from High Command.\r\n<br><br>\r\nSoon it is expected new production quotas and vehicle orders will cause factories to react to the continuing need to arm our men in the field.</span>\r\n</font>\r\n</td>\r\n</tr>\r\n</table>', 'False', '2014-02-17 15:24:01'),
(8, 2, 'playnow_allied_british_rdp1.html', '<table width="100%" border="0" cellspacing="0" cellpadding="5">\r\n<tr align="left" valign="top"> \r\n<td>\r\n<font face="Times New Roman, Times, serif" size="3">\r\n<b>\r\n<span class="papertimesbig">United Kingdom takes A13 out of service</span>\r\n</b>\r\n</font>\r\n<br>\r\n<font face="Arial, Helvetica, sans-serif" size="1">\r\n<span class="paperdefault">Citing poor battlfield effectiveness and the need to put resources towards better equipment, British High Command has ordered the Cruiser A13 Tank removed from British ground forces after extended service. Unnamed sources were quoted as saying this decision paves the way for new armor units but factory orders have not yet been announced.</span>\r\n</font> \r\n</td>\r\n</tr>\r\n</table>\r\n                                          ', '<table width="100%" border="0" cellspacing="0" cellpadding="5">\r\n<tr align="left" valign="top"> \r\n<td>\r\n<font face="Times New Roman, Times, serif" size="3">\r\n<b>\r\n<span class="papertimesbig">%TITLE%</span>\r\n</b>\r\n</font>\r\n<br>\r\n<font face="Arial, Helvetica, sans-serif" size="1">\r\n<span class="paperdefault">%BODY%</span>\r\n</font> \r\n</td>\r\n</tr>\r\n</table>\r\n                                          ', 'Pass', 43, 0, '<table width="100%" border="0" cellspacing="0" cellpadding="5">\r\n<tr align="left" valign="top"> \r\n<td>\r\n<font face="Times New Roman, Times, serif" size="3">\r\n<b>\r\n<span class="papertimesbig">\r\nCanada to Supply Allies\r\n</span>\r\n</b>\r\n</font>\r\n<br>\r\n<font face="Arial, Helvetica, sans-serif" size="1">\r\n<span class="paperdefault">\r\nDesperate to replace equipment lost in fierce fighting with Germany, the British Army now looks to Canada as a potential supplier of arms.\r\n<br><br>\r\nThe first order of tanks to be produced by Canada has been accepted by the Canadian Pacific Railway''s Angus Shop in Montreal, Quebec.</span></font> \r\n</td>\r\n</tr>\r\n</table>\r\n           ', 'False', '2014-02-17 15:44:02'),
(11, 2, 'playnow_allied_factory.html', '<table width="100%" border="0" cellspacing="0" cellpadding="5">\r\n<tr> \r\n<td>\r\n<font face="Times New Roman, Times, serif" size="4">\r\n<b>\r\n<span class="papertimeshuge">\r\nAllied Factories At Full Production</span>\r\n</b>\r\n</font>\r\n<br>\r\n<font size="1" face="Arial, Helvetica, sans-serif"> \r\n<span class="paperdefault">\r\nAllied factory output reaches its full potential as all production lines report production at full capacity. Factory managers are pleased with the work that is being done. </span>\r\n</font>                      </td>\r\n</tr>\r\n</table>', '<table width="100%" border="0" cellspacing="0" cellpadding="5">\r\n<tr> \r\n<td>\r\n<font face="Times New Roman, Times, serif" size="4">\r\n<b>\r\n<span class="papertimeshuge">%TITLE%</span>\r\n</b>\r\n</font>\r\n<br>\r\n<font size="1" face="Arial, Helvetica, sans-serif"> \r\n<span class="paperdefault">%BODY%</span>\r\n</font>                                      \r\n</td>\r\n</tr>\r\n</table>', 'Pass', 27, 0, '<table width="100%" border="0" cellspacing="0" cellpadding="5">\r\n<tr> \r\n<td>\r\n<font face="Times New Roman, Times, serif" size="4">\r\n<b>\r\n<span class="papertimeshuge">\r\nAllied Factories At Full Production</span>\r\n</b>\r\n</font>\r\n<br>\r\n<font size="1" face="Arial, Helvetica, sans-serif"> \r\n<span class="paperdefault">\r\nAllied factory output reaches its full potential as all production lines report production at full capacity. Factory managers are pleased with the work that is being done. </span>\r\n</font>                      </td>\r\n</tr>\r\n</table>', 'False', '2014-02-17 14:19:02'),
