(19, 2, 'playnow_french_rdp_status.html', '<table width="99%" border="0" cellspacing="0" cellpadding="2">\r\n<tr>\r\n   <td>\r\n<font face="Arial, Helvetica, sans-serif" size="1">\r\n<b><span class="paperdefault">French RDP Report</span></b></font>\r\n</td>\r\n</tr>\r\n<tr> \r\n	<td> \r\n		<table border="1" cellspacing="0" cellpadding="1" bordercolor="#000000">\r\n		<tr> \r\n			<td><font face="Arial, Helvetica, sans-serif" size="1"><span class="paperdefault">Factory Output: <b>100%</b> of capacity</span></font></td>\r\n		</tr>\r\n		<tr> \r\n			<td><font face="Arial, Helvetica, sans-serif" size="1"><span class="paperdefault">Current RDP Cycle: <b>59%</b> complete</span></font></td>\r\n		</tr>\r\n		<tr> \r\n			<td><font face="Arial, Helvetica, sans-serif" size="1"><span class="paperdefault">Estimated Completion: <b>3d2h</b></span></font></td>\r\n		</tr>\r\n		</table>\r\n	</td>\r\n</tr>\r\n</table>\r\n', '%BODY%', 'Pass', 21, 0, NULL, 'False', '2014-02-17 13:32:06'),
(20, 1, 'index_main_headline.html', '<table width="100%" border="0" cellspacing="0" cellpadding="3" align="center">\r\n<tr valign="top"> \r\n<td> \r\n<div align="center">\r\n<font face="Arial, Helvetica, sans-serif" size="7">\r\n<font color="#666666">\r\n<b>\r\n<span class="paperheadline">BRITISH FORCES FALLING BACK</span>\r\n</b>\r\n</font>\r\n</font>\r\n</div>\r\n</td>\r\n</tr>\r\n</table>', '<table width="100%" border="0" cellspacing="0" cellpadding="3" align="center">\r\n<tr valign="top"> \r\n<td> \r\n<div align="center">\r\n<font face="Arial, Helvetica, sans-serif" size="7">\r\n<font color="#666666">\r\n<b>\r\n<span class="paperheadline">%TITLE%</span>\r\n</b>\r\n</font>\r\n</font>\r\n</div>\r\n</td>\r\n</tr>\r\n</table>', 'Upper', 98, 0, '', 'False', '2014-02-17 13:41:01'),
(21, 1, 'index_allied_stats1.html', '<table border="0" cellspacing="0" cellpadding="5">\r\n<tr align="left" valign="top"> \r\n<td> \r\n<font size="4" face="Arial, Helvetica, sans-serif">\r\n<b>\r\n<span class="paperarialhuge">Germany on the Offensive</span>\r\n</b>\r\n</font>\r\n<br>\r\n<font size="1" face="Arial, Helvetica, sans-serif">\r\n<span class="paperdefault">German forces are on the offensive throughout Europe   as the conflict broadens. Axis forces are on the move in several locations across the front lines.\r\n<br><br>\r\nAll men of fighting age should stand at the ready to answer a call to arms and fight for your country.\r\n</span>\r\n</font>\r\n</td>\r\n</tr>\r\n</table>', '<table border="0" cellspacing="0" cellpadding="5">\r\n<tr align="left" valign="top"> \r\n<td> \r\n<font size="4" face="Arial, Helvetica, sans-serif">\r\n<b>\r\n<span class="paperarialhuge">%TITLE%</span>\r\n</b>\r\n</font>\r\n<br>\r\n<font size="1" face="Arial, Helvetica, sans-serif">\r\n<span class="paperdefault">%BODY%</span>\r\n</font>\r\n</td>\r\n</tr>\r\n</table>', 'Pass', 48, 0, '', 'False', '2014-02-17 13:37:01'),
(22, 1, 'index_axis_german_rdp1.html', '<table border="0" cellspacing="0" cellpadding="5">\r\n<tr align="left" valign="top"> \r\n<td>\r\n<font face="Arial, Helvetica, sans-serif" size="4">\r\n<b>\r\n<span class="paperarialhuge">Tiger to Enter Combat</span>\r\n</b>\r\n</font>\r\n<br>\r\n<font face="Arial, Helvetica, sans-serif" size="1">\r\n<span class="paperdefault">After months of hard work, German engineers have completed work on the PzKpfw VI E Tank. Army officials at Vervins were quoted as being quite happy with the new  better combat flexibility being introduced in the field.<br>\r\n<br>\r\nIt is hoped that sufficient numbers will win a greater battleground advantage against Allied  forces on the battlefield.\r\n</span>\r\n</font>\r\n</td>\r\n</tr>\r\n</table>', '<table border="0" cellspacing="0" cellpadding="5">\r\n<tr align="left" valign="top"> \r\n<td>\r\n<font face="Arial, Helvetica, sans-serif" size="4">\r\n<b>\r\n<span class="paperarialhuge">%TITLE%</span>\r\n</b>\r\n</font>\r\n<br>\r\n<font face="Arial, Helvetica, sans-serif" size="1">\r\n<span class="paperdefault">%BODY%</span>\r\n</font>\r\n</td>\r\n</tr>\r\n</table>', 'Pass', 40, 0, '<table border="0" cellspacing="0" cellpadding="5">\r\n<tr align="left" valign="top"> \r\n<td>\r\n<font face="Arial, Helvetica, sans-serif" size="4">\r\n<b>\r\n<span class="paperarialhuge">\r\nGERMAN INDUSTRY AT THE READY\r\n</span>\r\n</b>\r\n</font>\r\n<br>\r\n<font face="Arial, Helvetica, sans-serif" size="1">\r\n<span class="paperdefault">\r\nAs German High Command is poised to unveil RDP plans, German industry is preparing to react to new vehicle and weapon orders.\r\n</span>\r\n</font>\r\n</td>\r\n</tr>\r\n</table>', 'False', '2014-02-17 15:50:03'),
(23, 1, 'index_allied_british_rdp1.html', '<table width="100%" border="0" cellspacing="0" cellpadding="5">\r\n<tr valign="top" align="left"> \r\n<td> \r\n<font face="Arial, Helvetica, sans-serif" size="1">\r\n<span class="paperdefault">British Army High Command Officials announced today that several gun class combat units will get QF 6pdr units in greater numbers by the end of this cycle. Fighting near Achel has slowed enough to allow  convoy of these units to the front. Opposing Axis forces were expected to meet this  change in enemy initiatives in the coming RD&P cycles, but the huge increase will be a welcome addition to the British Army front line forces.</span>\r\n</font>\r\n</td>\r\n</tr>\r\n</table>', '<table width="100%" border="0" cellspacing="0" cellpadding="5">\r\n<tr valign="top" align="left"> \r\n<td> \r\n<font face="Arial, Helvetica, sans-serif" size="1">\r\n<span class="paperdefault">%BODY%</span>\r\n</font>\r\n</td>\r\n</tr>\r\n</table>', 'Pass', 112, 0, '<table width="100%" border="0" cellspacing="0" cellpadding="5">\r\n<tr valign="top" align="left"> \r\n<td> \r\n<font face="Arial, Helvetica, sans-serif" size="1">\r\n<span class="paperdefault">\r\nRecent meetings between industry leaders and Allied Command took place near London.\r\n<br><br>\r\nInsiders say that Command has said the industrial war machine must make itself ready for the forthcoming factory orders for both increases and new vehicle production.\r\n</span>\r\n</font>\r\n</td>\r\n</tr>\r\n</table>', 'False', '2014-02-17 15:59:03'),
(24, 1, 'index_allied_french_rdp1.html', '<table width="100%" border="0" cellspacing="0" cellpadding="5">\r\n<tr align="left" valign="top"> \r\n<td> \r\n<font face="Arial, Helvetica, sans-serif" size="1">\r\n<span class="paperdefault">In order to focus on other  more effective weapon types, France has announced a % decrease on Somua S35 Tank production lines. The directive is expected to take effect by the end of this production cycle. Sources were unsure if the decrease would make room for more modern armor class units or if the additional resources would be used to fill other equipment needs within alternative branches of the France military.</span>\r\n</font>\r\n</td>\r\n</tr>\r\n</table>', '<table width="100%" border="0" cellspacing="0" cellpadding="5">\r\n<tr align="left" valign="top"> \r\n<td> \r\n<font face="Arial, Helvetica, sans-serif" size="1">\r\n<span class="paperdefault">%BODY%</span>\r\n</font>\r\n</td>\r\n</tr>\r\n</table>', 'Pass', 55, 0, '<table width="100%" border="0" cellspacing="0" cellpadding="5">\r\n<tr align="left" valign="top"> \r\n<td> \r\n<font face="Arial, Helvetica, sans-serif" size="1">\r\n<span class="paperdefault">\r\n"We must not fail to prepare for what lies ahead." This was the recent message from French military officials in a public addess directly squarly towards French industry.\r\n<br><br>\r\nFactories across France and french-held territories are stocking up on oil and raw materials in anticipation of new orders from Allied High Command.\r\n</span>\r\n</font>\r\n</td>\r\n</tr>\r\n</table>', 'False', '2014-02-17 15:59:03'),
(25, 1, 'index_axis_stats1.html', '<table width="121" border="0" cellspacing="0" cellpadding="5">\r\n<tr align="left" valign="top"> \r\n<td> \r\n<font size="4" face="Times New Roman, Times, serif">\r\n<b>\r\n<span class="papertimeshuge">Germany Controls The Skies</span>\r\n</b>\r\n</font>\r\n<br>\r\n<font size="1" face="Arial, Helvetica, sans-serif">\r\n<span class="paperdefault">Germany now owns 64% of the airfields in the European Theatre of Operations. With this decided advantage, forward air units are now able to wreak havoc on enemy factories and front line positions.</span>\r\n</font>\r\n</td>\r\n</tr>\r\n</table>', '<table width="121" border="0" cellspacing="0" cellpadding="5">\r\n<tr align="left" valign="top"> \r\n<td> \r\n<font size="4" face="Times New Roman, Times, serif">\r\n<b>\r\n<span class="papertimeshuge">%TITLE%</span>\r\n</b>\r\n</font>\r\n<br>\r\n<font size="1" face="Arial, Helvetica, sans-serif">\r\n<span class="paperdefault">%BODY%</span>\r\n</font>\r\n</td>\r\n</tr>\r\n</table>', 'Pass', 58, 350, '', 'False', '2014-02-17 14:22:01'),
(26, 2, 'allied_playnow_axis_rdp1.html', '<table border="0" cellspacing="0" cellpadding="5">\r\n<tr align="left" valign="top"> \r\n<td>\r\n<font face="Arial, Helvetica, sans-serif" size="1">\r\n<span class="paperdefault">Due to  losses at the front to PzKpfw III F Tank production of existing models has been cut back this cycle. A % decrease has been issued to all PzKpfw III F Tank production facilities while tooling up for newer weapons takes place. "We are preparing to send improved weapons to the front to guarrentee victory" said one German official at Berlaimont when pressed for comment on the continuing  weapons production being applied to the war effort.</span>\r\n</font>\r\n</td>\r\n</tr>\r\n</table>', '<table border="0" cellspacing="0" cellpadding="5">\r\n<tr align="left" valign="top"> \r\n<td>\r\n<font face="Arial, Helvetica, sans-serif" size="1">\r\n<span class="paperdefault">%BODY%</span>\r\n</font>\r\n</td>\r\n</tr>\r\n</table>', 'Pass', 88, 0, '<table border="0" cellspacing="0" cellpadding="5">\r\n<tr align="left" valign="top"> \r\n<td>\r\n<font face="Arial, Helvetica, sans-serif" size="1">\r\n<span class="paperdefault">\r\nGerman factories now await new orders and production lists from High Command.\r\n<br><br>\r\nSources inside Germany say they are concerned of growing labor shortages in all sectors and the increased reliance on unskilled workers to make up the workforce.\r\n</span>\r\n</font>\r\n</td>\r\n</tr>\r\n</table>', 'False', '2014-02-17 16:10:02'),
(27, 3, 'playnow_axis_stats2.html', '<table width="100%" border="0" cellspacing="0" cellpadding="0">\r\n<tr align="left" valign="top"> \r\n<td>\r\n<font face="Arial, Helvetica, sans-serif" size="2">\r\n<b>\r\n<span class="paperarialmedium">Germany Marches Forward!</span>\r\n</b>\r\n</font>\r\n<br>\r\n<font face="Arial, Helvetica, sans-serif" size="1">\r\n<span class="paperdefault">Successes all along the front lines were felt by enemy forces as German air, armor and \r\ninfantry units punched holes through front line positions. German population centers eager for victory cheered as the news spread across the country.</span>\r\n</font>\r\n</td>\r\n</tr>\r\n</table>', '<table width="100%" border="0" cellspacing="0" cellpadding="0">\r\n<tr align="left" valign="top"> \r\n<td>\r\n<font face="Arial, Helvetica, sans-serif" size="2">\r\n<b>\r\n<span class="paperarialmedium">%TITLE%</span>\r\n</b>\r\n</font>\r\n<br>\r\n<font face="Arial, Helvetica, sans-serif" size="1">\r\n<span class="paperdefault">%BODY%</span>\r\n</font>\r\n</td>\r\n</tr>\r\n</table>', 'Pass', 59, 0, '', 'False', '2014-02-17 14:04:31'),
(28, 3, 'playnow_axis_stats1.html', '<table border="0" cellspacing="0" cellpadding="5" width="230">\r\n<tr> \r\n<td>\r\n<font size="3" face="Arial, Helvetica, sans-serif">\r\n<b>\r\n<span class="paperarialbig">German Defensive Positions Under Pressure</span>\r\n</b>\r\n</font>\r\n<br>\r\n<font face="Arial, Helvetica, sans-serif" size="1">\r\n<span class="paperdefault">German armor and infantry forces  continue to throw units into the meatgrinder\r\n along a line of 302 miles as Allied air and ground forces  squeeze the life out of their positions. People throughout the region of 36 frontline cities and towns held by German forces are moving to the rear of the lines while Allied forces move up to do whatever they can to prevent a breakthrough.</span>\r\n</font>\r\n</td>\r\n</tr>\r\n</table>', '<table border="0" cellspacing="0" cellpadding="5" width="230">\r\n<tr> \r\n<td>\r\n<font size="3" face="Arial, Helvetica, sans-serif">\r\n<b>\r\n<span class="paperarialbig">%TITLE%</span>\r\n</b>\r\n</font>\r\n<br>\r\n<font face="Arial, Helvetica, sans-serif" size="1">\r\n<span class="paperdefault">%BODY%</span>\r\n</font>\r\n</td>\r\n</tr>\r\n</table>', 'Pass', 114, 0, '', 'False', '2014-02-17 14:15:03'),
(30, 3, 'playnow_axis_german_rdp1.html', '<table width="100%" border="0" cellspacing="0" cellpadding="5">\r\n<tr align="left" valign="top"> \r\n<td>\r\n<font face="Times New Roman, Times, serif" size="3">\r\n<b>\r\n<span class="papertimesbig">Tiger Units to Enter Service</span>\r\n</b>\r\n</font>\r\n<br>\r\n<font face="Arial, Helvetica, sans-serif" size="1">\r\n<span class="paperdefault">As a result of many man-hours in design and planning, German engineers have completed work on the PzKpfw VI E Tank. Army officials at Vireaux were quoted as being quite happy with the  anticipated increase in combat effectiveness with this introduction.<br></span>\r\n</font> \r\n</td>\r\n</tr>\r\n</table>\r\n                                          ', '<table width="100%" border="0" cellspacing="0" cellpadding="5">\r\n<tr align="left" valign="top"> \r\n<td>\r\n<font face="Times New Roman, Times, serif" size="3">\r\n<b>\r\n<span class="papertimesbig">%TITLE%</span>\r\n</b>\r\n</font>\r\n<br>\r\n<font face="Arial, Helvetica, sans-serif" size="1">\r\n<span class="paperdefault">%BODY%</span>\r\n</font> \r\n</td>\r\n</tr>\r\n</table>\r\n                                          ', 'Pass', 8, 0, '<table width="100%" border="0" cellspacing="0" cellpadding="5">\r\n<tr align="left" valign="top"> \r\n<td>\r\n<font face="Times New Roman, Times, serif" size="3">\r\n<b>\r\n<span class="papertimesbig">\r\nWar Production Uncertain\r\n</span>\r\n</b>\r\n</font>\r\n<br>\r\n<font face="Arial, Helvetica, sans-serif" size="1">\r\n<span class="paperdefault">\r\nWhile the Axis High Command meets with all branches of the military, weapon and vehicle factories are awaiting orders.\r\n<br><br>\r\nIt is unknown what vehicles will be selected for production increases or which may be phased out in the coming days.\r\n</span>\r\n</font> \r\n</td>\r\n</tr>\r\n</table>', 'False', '2014-02-17 16:10:02'),
(31, 3, 'playnow_axis_factory.html', '<table width="100%" border="0" cellspacing="0" cellpadding="5">\r\n<tr> \r\n<td>\r\n<font face="Times New Roman, Times, serif" size="4">\r\n<b>\r\n<span class="papertimeshuge">\r\nAxis Factories At Full Production\r\n</span>\r\n</b>\r\n</font>\r\n<br>\r\n<font size="1" face="Arial, Helvetica, sans-serif"> \r\n<span class="paperdefault">\r\nAxis factory output reaches its full potential as all production lines report production at full capacity. Factory managers are pleased with the work that is being done. \r\n</span>\r\n</font>                      </td>\r\n</tr>\r\n</table>', '<table width="100%" border="0" cellspacing="0" cellpadding="5">\r\n<tr> \r\n<td>\r\n<font face="Times New Roman, Times, serif" size="4">\r\n<b>\r\n<span class="papertimeshuge">%TITLE%</span>\r\n</b>\r\n</font>\r\n<br>\r\n<font size="1" face="Arial, Helvetica, sans-serif"> \r\n<span class="paperdefault">%BODY%</span>\r\n</font>                                      \r\n</td>\r\n</tr>\r\n</table>', 'Pass', 27, 0, '<table width="100%" border="0" cellspacing="0" cellpadding="5">\r\n<tr> \r\n<td>\r\n<font face="Times New Roman, Times, serif" size="4">\r\n<b>\r\n<span class="papertimeshuge">\r\nAxis Factories At Full Production\r\n</span>\r\n</b>\r\n</font>\r\n<br>\r\n<font size="1" face="Arial, Helvetica, sans-serif"> \r\n<span class="paperdefault">\r\nAxis factory output reaches its full potential as all production lines report production at full capacity. Factory managers are pleased with the work that is being done. \r\n</span>\r\n</font>                      </td>\r\n</tr>\r\n</table>', 'False', '2014-02-17 13:33:02'),
