(38, 3, 'axis_playnow_allied_rdp1.html', '<table border="0" cellspacing="0" cellpadding="5">\r\n<tr align="left" valign="top"> \r\n<td>\r\n<font face="Arial, Helvetica, sans-serif" size="1">\r\n<span class="paperdefault">After years of service, the Renault R35 Tank is being retired from French ground forces. While political reasons were blamed for the decision, quietly officers in the French High Command were quoted as saying they were making room for better armor units. The  more capable units should see action by the end of this production cycle.</span>\r\n</font>\r\n</td>\r\n</tr>\r\n</table>', '<table border="0" cellspacing="0" cellpadding="5">\r\n<tr align="left" valign="top"> \r\n<td>\r\n<font face="Arial, Helvetica, sans-serif" size="1">\r\n<span class="paperdefault">%BODY%</span>\r\n</font>\r\n</td>\r\n</tr>\r\n</table>', 'Pass', 4, 0, '<table border="0" cellspacing="0" cellpadding="5">\r\n<tr align="left" valign="top"> \r\n<td>\r\n<font face="Arial, Helvetica, sans-serif" size="1">\r\n<span class="paperdefault">\r\nDesperate to replace equipment lost in fierce fighting with Germany, the British Army now looks to Canada as a potential supplier of arms.\r\n<br><br>\r\nThe first order of tanks to be produced by Canada has been accepted by the Canadian Pacific Railway''s Angus Shop in Montreal, Quebec.\r\n</span>\r\n</font>\r\n</td>\r\n</tr>\r\n</table>\r\n\r\n', 'False', '2014-02-17 15:18:05'),
