(46, 1, 'index_axis_stats2.html', '<table width="100%" border="0" cellspacing="0" cellpadding="0">\r\n<tr align="left" valign="top"> \r\n<td> \r\n<font size="3" face="Times New Roman, Times, serif">\r\n<b>\r\n<span class="papertimesbig">Recent Airfield Analysis Results</span>\r\n</b>\r\n</font>\r\n<br>\r\n<font size="1" face="Arial, Helvetica, sans-serif">\r\n<span class="paperdefault">An independent analysis of military airfields controlled by the major combatants indicate that Germany now controls 64% of the airfields (35 total), followed by United Kingdom with 20% (11) and France with 14% (8).</span>\r\n</font>\r\n</td>\r\n</tr>\r\n</table>', '<table width="100%" border="0" cellspacing="0" cellpadding="0">\r\n<tr align="left" valign="top"> \r\n<td> \r\n<font size="3" face="Times New Roman, Times, serif">\r\n<b>\r\n<span class="papertimesbig">%TITLE%</span>\r\n</b>\r\n</font>\r\n<br>\r\n<font size="1" face="Arial, Helvetica, sans-serif">\r\n<span class="paperdefault">%BODY%</span>\r\n</font>\r\n</td>\r\n</tr>\r\n</table>', 'Pass', 50, 300, '', 'False', '2014-02-17 14:28:01');
