(50, 1, 'index_allied_stats2.html', '<table width="100%" border="0" cellspacing="0" cellpadding="0">\r\n<tr align="left" valign="top"> \r\n<td> \r\n<font size="3" face="Times New Roman, Times, serif">\r\n<b>\r\n<span class="papertimesbig">French Victory at a Cost</span>\r\n</b>\r\n</font>\r\n<br>\r\n<font size="1" face="Arial, Helvetica, sans-serif">\r\n<span class="paperdefault">Recent published reports from military headquarters are showing  telling results. Based on battlefield reports, 0% of mission objectives are achieved but with a high cost of 37% of our  combat units lost in combat.</span>\r\n</font>\r\n</td>\r\n</tr>\r\n</table>', '<table width="100%" border="0" cellspacing="0" cellpadding="0">\r\n<tr align="left" valign="top"> \r\n<td> \r\n<font size="3" face="Times New Roman, Times, serif">\r\n<b>\r\n<span class="papertimesbig">%TITLE%</span>\r\n</b>\r\n</font>\r\n<br>\r\n<font size="1" face="Arial, Helvetica, sans-serif">\r\n<span class="paperdefault">%BODY%</span>\r\n</font>\r\n</td>\r\n</tr>\r\n</table>', 'Pass', 42, 300, '', 'False', '2014-02-17 14:21:02'),
(51, 1, 'index_randomstats.html', '<table border="0" cellspacing="0" cellpadding="5">\r\n<tr align="left" valign="top"> \r\n<td> \r\n<font size="4" face="Times New Roman, Times, serif">\r\n<b>\r\n<span class="papertimesbig">Aussies Study the War</span></b>\r\n</font>\r\n<br>\r\n<font size="1" face="Arial, Helvetica, sans-serif">\r\n<span class="paperdefault">Australian military officials have recently issued classified reports regarding recent war casualties on the offensive. Leaked information indicates a 51% of the attack missions were accomplished at a 0% success rate.<br><br>\r\n\r\nParticipants in these missions returned to base 48% of the time; each participant killed on average 0.35 enemy units.</span></\r\n</font>\r\n</td>\r\n</tr>\r\n</table> ', '<table border="0" cellspacing="0" cellpadding="5">\r\n<tr align="left" valign="top"> \r\n<td> \r\n<font size="4" face="Times New Roman, Times, serif">\r\n<b>\r\n<span class="papertimesbig">%TITLE%</span></b>\r\n</font>\r\n<br>\r\n<font size="1" face="Arial, Helvetica, sans-serif">\r\n<span class="paperdefault">%BODY%</span></\r\n</font>\r\n</td>\r\n</tr>\r\n</table> ', 'Random', 46, 0, '', 'False', '2014-02-17 14:19:03'),
(52, 2, 'playnow_allied_stats2.html', '<table width="100%" border="0" cellspacing="0" cellpadding="0">\r\n<tr align="left" valign="top"> \r\n<td>\r\n<font face="Arial, Helvetica, sans-serif" size="2">\r\n<b>\r\n<span class="paperarialmedium">Germany on the Offensive</span>\r\n</b>\r\n</font>\r\n<br>\r\n<font face="Arial, Helvetica, sans-serif" size="1">\r\n<span class="paperdefault">German forces are on the offensive throughout Europe   as the conflict broadens. Axis forces are on the move in several locations across the front lines.\r\n<br><br>\r\nAll men of fighting age should stand at the ready to answer a call to arms and fight for your country.\r\n</span>\r\n</font>\r\n</td>\r\n</tr>\r\n</table>', '<table width="100%" border="0" cellspacing="0" cellpadding="0">\r\n<tr align="left" valign="top"> \r\n<td>\r\n<font face="Arial, Helvetica, sans-serif" size="2">\r\n<b>\r\n<span class="paperarialmedium">%TITLE%</span>\r\n</b>\r\n</font>\r\n<br>\r\n<font face="Arial, Helvetica, sans-serif" size="1">\r\n<span class="paperdefault">%BODY%</span>\r\n</font>\r\n</td>\r\n</tr>\r\n</table>', 'Pass', 48, 0, '', 'False', '2014-02-17 14:19:03'),
