INSERT INTO `templates` (`template_id`, `title`, `body`, `variety_1`, `variety_2`, `duplicates`, `added`, `modified`) VALUES
(1, '%VEHICLE_SHORT% Production Slows Down!', 'Over the past few weeks, %COUNTRY_ADJ% factories have slowed production of %VEHICLE_SHORT% forces due to increased demands on industrial sectors of the country for other %VARIETY1% weapon types. The rather %DECREASE_ADJ% decrease isn''t expected to be felt by combat units at the frontlines until the end of this production cycle.', 'more modern; deadlier; better performing; more up to date', '', 'Disallow', '2003-07-01 16:15:46', '2004-04-27 15:22:19'),
(4, '%COUNTRY% retires the %VEHICLE_SHORT%!', 'After years of service, the %VEHICLE% is being retired from %COUNTRY_ADJ% %CATEGORY%. While %VARIETY1% were blamed for the decision, quietly officers in the %COUNTRY_ADJ% High Command were quoted as saying they were making room for better %CLASS% units. The %VARIETY2% units should see action by the end of this production cycle.', 'political reasons;\r\nlack of resources; questions of combat effectiveness', 'improved; more effective; newer; more capable', 'Disallow', '2003-07-03 00:25:55', '2004-03-19 21:32:48'),
(5, 'Production of %VEHICLE% units to be increased!', 'News out of the %COUNTRY_ADJ% High Command today %VARIETY1% a %PERCENTAGE_INCREASE%% increase in output of %VEHICLE% units this cycle.<br>\r\n<br>\r\nOfficials outside of %CITY% City Hall were characterized as quite happy with the news and were quoted as saying, "This will be a significant %VARIETY2% to our %CLASS% forces fighting in the field".', 'speaks of; mentions; indicated; reveals the possibility of', 'increase; advantage; edge; morale boost', 'Disallow', '2003-07-03 00:31:51', '2004-04-26 19:10:51'),
(6, '%VEHICLE% productions quotas not met!', 'Due to %VARIETY1% in %DIRECTION_ADJ% %COUNTRY%, productions quotas could not be met for %VEHICLE_SHORT% units this cycle. A %PERCENTAGE_DECREASE%% decrease has been issued to all %VEHICLE_SHORT% production facilities until the situation improves. "Efforts along the front shouldn''t be badly affected by this untimely outcome" said one %COUNTRY_ADJ% official at %CITY% when asked to comment.\r\n', 'resource shortfalls;\r\nsabotage; bombing raid damage', '', 'Disallow', '2003-07-03 00:34:53', '2004-03-19 21:20:34'),
(7, 'Better conditions allow improved %VEHICLE% outputs!', 'Factories in %DIRECTION_ADJ% %COUNTRY% have been refitted with new machinery. A let up in the bombing and an increase in diverted resources has allowed %VARIETY1% to be shipped from %CITY%. Military officials in %CITY% said they were holding off on sending the equipment until sufficient %VARIETY2% could be provided for the journey.<br><br> Production of more %CLASS% units is expected to be increased by %PERCENT_INCREASE% by the end of this cycle.', 'increased production; higher factory outputs; more weapons', 'escort protection; convoy escort; protective cover', 'Disallow', '2003-07-03 00:41:07', '2004-04-26 19:12:34'),
(8, '%VEHICLE_SHORT% Units to Enter Service', 'As a result of many %VARIETY1% in design and planning, %COUNTRY_ADJ% engineers have completed work on the %VEHICLE%. %BRANCH% officials at %CITY% were quoted as being quite happy with the %VARIETY2% introduction.<br>', 'man-hours; new objectives; changes of combat requirements', 'new combat designs; anticipated increase in combat effectiveness with this; frontline advantage expected from the new equipments', 'Disallow', '2003-07-03 00:46:26', '2004-03-22 00:59:35'),
(9, 'Improvements made to the %VEHICLE% Production Line.', 'According to the %COUNTRY_ADJ% %VARIETY2%, %VEHICLE% production should be up %PERCENTAGE_INCREASE%% this cycle. %FACTORY_CITY%''s RD&P sector has %VARIETY1% which have flowed on to become a %INCREASE_ADJ% increase in production targets. The increase should be felt by front line units by the end of this production cycle.', 'received upgrades;\r\nreceived higher %VEHICLE% budgets; increased requests for %VEHICLE_SHORT%s', 'High Command;\r\nMilitary Manufacturing Relations Department', 'Disallow', '2003-07-03 12:43:17', '2004-04-26 19:12:04'),
(10, '%COUNTRY% Restructures it''s Armed Forces.', '%COUNTRY_ADJ% %BRANCH% Officials announced today that several %CLASS% class units will get new %VEHICLE% units by the end of this cycle. %VARIETY1% %VARIETY2% %FRONT_CITY% has subsided enough to move the units to the front. %ENEMY_SIDE% forces were expected to meet the move in the coming days, but the %INCREASE_ADJ% increase in supply will still be a handy addition to all %COUNTRY_ADJ% front line forces in the war.', 'Fighting; The battle; The heavy skirmish; Conflict', 'around; near; in the vincinity of; in the region of; surrounding', 'Disallow', '2003-07-03 12:47:12', '2004-04-26 19:13:11'),
(11, '%COUNTRY% Moves New Recruits to the Front!', '%COUNTRY_ADJ% ground forces were bolstered due to %VARIETY1% and re-organization of  units in the rear. The troops were seen massing around the %COUNTRY_ADJ% controlled town of %CITY%. It is believed they will be used in the fight for %ANY_CON_CITY%, but our sources wouldn''t say for sure. ', 'new recruiting drives;\r\nincreased enlistments;', '', 'Disallow', '2003-07-03 14:38:56', '2003-07-29 21:44:44'),
(13, 'PITCHED BATTLE FOR %CON_CITY%', '%CON_CITY% fought over!', '', '', 'Disallow', '2003-07-08 13:00:53', '2003-07-29 21:44:44'),
(15, 'Control for the Continent Weighed!', 'Near the %COUNTRY_ADJ% controlled town of %CITY%, an unamed %COUNTRY_ADJ% official leaked a new intelligence report showing that %1ST_COUNTRY% now controls %1ST_PERCENT%% of the European Theatre of operations. %2ND_COUNTRY% owns %2ND_PERCENT%% and %3RD_COUNTRY% owns %3RD_PERCENT%%. The report also shows that all combatants are stepping up efforts to push the front forward and take control of the front.', '', '', 'Disallow', '2003-07-08 13:09:04', '2003-07-29 21:44:44'),
(16, '%PLAYER% Recognized for Outstanding Effort!', '%COUNTRY_ADJ% military officials recognized %PLAYER% for an outstanding effort on %MONTH% %DAY_ORD%. %PLAYER% killed %KILLS% enemy units and attacked multiple targets during a mission that lasted %DURATION% minutes long. After the mission, he was listed as <i>%RTB%</i>.', '', '', 'Disallow', '2003-07-08 13:15:41', '2003-07-30 16:12:49'),
