(18, 'Past RDP Headlines', '<tr> \r\n  <td valign="top">\r\n  <font face="Arial, Helvetica, sans-serif" size="1">\r\n <span class="paperarialsmall">%TITLE%</span>\r\n  </font>\r\n  </td>\r\n</tr>', '', '', 'Disallow', '2003-07-08 16:30:46', '2005-02-11 21:32:41'),
(21, 'RDP Status Template', '<table width="99%" border="0" cellspacing="0" cellpadding="2">\r\n<tr>\r\n   <td>\r\n<font face="Arial, Helvetica, sans-serif" size="1">\r\n<b><span class="paperdefault">%COUNTRY_ADJ% RDP Report</span></b></font>\r\n</td>\r\n</tr>\r\n<tr> \r\n	<td> \r\n		<table border="1" cellspacing="0" cellpadding="1" bordercolor="#000000">\r\n		<tr> \r\n			<td><font face="Arial, Helvetica, sans-serif" size="1"><span class="paperdefault">Factory Output: <b>%OUTPUT%%</b> of capacity</span></font></td>\r\n		</tr>\r\n		<tr> \r\n			<td><font face="Arial, Helvetica, sans-serif" size="1"><span class="paperdefault">Current RDP Cycle: <b>%COMPLETION%%</b> complete</span></font></td>\r\n		</tr>\r\n		<tr> \r\n			<td><font face="Arial, Helvetica, sans-serif" size="1"><span class="paperdefault">Estimated Completion: <b>%ETA%</b></span></font></td>\r\n		</tr>\r\n		</table>\r\n	</td>\r\n</tr>\r\n</table>\r\n', '', '', 'Allow', '2003-07-08 21:03:19', '2005-02-11 21:38:15'),
