(25, '%ENEMY_COUNTRY_ADJ% Air Power Pounds %SIDE% Factories', '%ENEMY_COUNTRY_ADJ% %CLASS% units have been hitting %SIDE% factories day and night which has resulted in the shutdown of all production at %FACTORY_CITY%. The latest reports show that %FACTORY_DAMAGE%% of the complex has been destroyed. Workers brave the bombing 24 hours a day in an attempt to repair the damage.', '', '', 'Disallow', '2003-07-10 12:41:25', '2003-07-29 21:44:44'),
(26, '%COUNTRY_ADJ% Factories Hit Hard', 'Over the past few days, %COUNTRY_ADJ% factories in the %DIRECTION% have been under %INTENSITY% attack by enemy bombers. \r\nAdditional anti-air artillery units are being brought over from %CITY% to help protect the important complex near %FACTORY_CITY%. The damage has taken its toll, dropping factory output to %FACTORY_OUTPUT%% of total capacity.', '', '', 'Disallow', '2003-07-10 18:22:16', '2003-07-30 02:42:34'),
(27, '%FACTORY_CITY% Factory Captured!', 'In a radio address from  %CAPTURING_COUNTRY_ADJ% Command at %MILITARY_TIME% today, it was reported that  %CLASS% forces have taken the critical industrial city of %FACTORY_CITY%. \r\n<br>\r\n<br>\r\nA lot of %INTENSITY% fighting continued in the %DIRECTION_ADJ% side of the installation, but %CAPTURING_COUNTRY% commanders seemed assured in maintaining control of the facility.', '', '', 'Disallow', '2003-07-10 18:29:58', '2003-08-17 15:54:40'),
(28, '%SIDE% Forces Defend %FACTORY_CITY%', 'On %DAY%, %MONTH% %DAY_ORD%, %ATTACKING_COUNTRY_ADJ% %CLASS% units attacked and successfully took %PERCENT_ENEMY%% of the factory complex at %FACTORY_CITY%. %SIDE% forces frantically fought for control in the %DIRECTION_ADJ% portions of the city. The fighting has taken its toll as factory output is down to %FACTORY_OUTPUT%% of capacity with %FACTORY_DAMAGE%% of the complex damaged.', '', '', 'Disallow', '2003-07-10 18:54:59', '2003-08-08 03:18:08'),
(29, '%ENEMY_SIDE% %VARIETY2% %VARIETY1%  %CITY%!', '%ENEMY_SIDE% %VARIETY2% %VARIETY1% %CITY%!', 'SURROUND; BESIEGE; ENCIRCLE', 'UNITS; FORCES', 'Disallow', '2003-07-14 22:23:01', '2003-08-08 04:06:39'),
(30, '%ENEMY_SIDE% FORCES THREATEN %CITY%', '%ENEMY_SIDE% FORCES THREATEN %CITY%', '', '', 'Disallow', '2003-07-14 22:24:11', '2003-07-29 21:44:44'),
