(36, '%COUNTRY_ADJ% Sortie Stats', 'Military officials found that over the last %SORTIES_TOTAL% sorties, an average of %AVERAGE_TIME% minutes was spent on each combat mission. %AVERAGE_SUCCESS%% of those missions resulted in the successful completion of their objectives with %AVERAGE_RTB%% of the combatants returned to base. %AVERAGE_KIA%% were killed in action. The study also revealed that an average of %AVERAGE_KILLS% enemy units were destroyed.\r\n', '', '', 'Disallow', '2003-07-14 23:08:06', '2003-07-30 16:39:31'),
