(40, '%VEHICLE_SHORT% to Enter Combat', 'After months of hard work, %COUNTRY_ADJ% engineers have completed work on the %VEHICLE%. %BRANCH% officials at %CITY% were quoted as being quite happy with the new %VARIETY1% being introduced in the field.<br>\r\n<br>\r\nIt is hoped that sufficient numbers will win a %VARIETY2% against %ENEMY_SIDE% %ENEMY_VEHICLE% forces on the battlefield.\r\n', 'combat units; improved battlefield units; better combat flexibility', 'greater battleground advantage; decisive advantage; superior combat edge', 'Disallow', '2003-07-28 19:24:04', '2004-03-22 02:17:22'),
(41, 'Casualty Reporter', 'GROUND FORCES %ARMY_CASUALTIES%<br>\r\nAIR FORCES %AIR_CASUALTIES%<br>\r\nSEA FORCES %NAVY_CASUALTIES%', '', '', 'Allow', '2003-07-28 23:49:27', '2003-07-29 21:50:39'),
(42, '%COUNTRY_ADJ% Victory at a Cost', 'Recent published reports from military headquarters are showing %VARIETY1% results. Based on battlefield reports, %AVERAGE_SUCCESS%% of mission objectives are achieved but with a high cost of %AVERAGE_KIA%% of our %VARIETY2% lost in combat.', 'alarming; worrying; less than favourable; telling', 'fighting men; forces; combat units; frontline personnel', 'Disallow', '2003-07-29 11:28:47', '2004-03-23 00:26:32'),
(43, '%COUNTRY% takes %VEHICLE_SHORT% out of service', 'Citing poor battlfield effectiveness and the need to put resources towards better equipment, %COUNTRY_ADJ% High Command has ordered the %VEHICLE% removed from %COUNTRY_ADJ% %CATEGORY% after extended service. Unnamed sources were quoted as saying this decision paves the way for new %CLASS% units but factory orders have not yet been announced.', '', '', 'Disallow', '2003-07-29 14:05:59', '2004-03-19 21:11:16'),
(44, '%COUNTRY% Introduces %VEHICLE_SHORT% to Combat Units', 'Frontline %COUNTRY_ADJ% units are now being issued the first %VARIETY2% of the %VEHICLE% in anticipation of immediate combat service. %BRANCH% officials visiting %CITY% were said to be quite %VARIETY1% at the introduction of the %VEHICLE_SHORT%.', 'happy; satisfied; pleased; impressed', 'production runs; combat versions', 'Disallow', '2003-07-29 17:00:01', '2004-03-22 00:53:43'),
(45, 'Campaign Started', 'Campaign Started', '', '', 'Disallow', '2003-07-29 17:34:25', '2003-09-14 19:26:26'),
(46, 'Aussies Study the War', 'Australian military officials have recently issued classified reports regarding recent war casualties on the offensive. %VARIETY1% a %AVERAGE_ATTACK%% of the attack missions were accomplished at a %AVERAGE_SUCCESS%% success rate.<br><br>\r\n\r\nParticipants in these missions returned to base %AVERAGE_RTB%% of the time; each participant killed on average %AVERAGE_KILLS% enemy units.', 'Leaked information indicates; Sources reveal; Analysis indicates; Published reports show', '', 'Disallow', '2003-07-29 18:46:11', '2003-09-10 16:35:24'),
(47, 'Americans Study the War', 'American military officials have recently issued classified reports regarding recent war casualties on the defensive. %VARIETY1% %AVERAGE_DEFENSE%% of defensive missions had a %AVERAGE_SUCCESS%% success rate.<br><br>\r\n\r\nOn these missions %AVERAGE_KIA%% are killed (KIA) and another %AVERAGE_MIA%% are missing in action (MIA).', 'Leaked information indicates; Sources reveal; Analysis indicates; Published reports show', '', 'Disallow', '2003-07-29 18:50:11', '2003-08-08 04:16:32'),
(48, '%OFFENSIVE_COUNTRY% on the Offensive', '%OFFENSIVE_COUNTRY_ADJ% forces are on the offensive throughout Europe %VARIETY1%. %OFFENSIVE_SIDE% forces are on the move in several locations across the front lines.\r\n<br><br>\r\nAll men of fighting age should stand at the ready to answer a call to arms and fight for your country.\r\n', 'as the war perhaps takes a new turn;  as fighting intensifies;  as the conflict broadens', '', 'Disallow', '2003-07-29 18:59:42', '2003-07-30 16:57:19'),
(49, 'War Effort Update', 'An independent analysis of civilian areas owned by the major combatants indicate that %1ST_COUNTRY% now controls %1ST_PERCENT%% of the major population centers (%1ST_COUNT% total), followed by %2ND_COUNTRY% with %2ND_PERCENT%% (%2ND_COUNT%) and %3RD_COUNTRY% with %3RD_PERCENT%% (%3RD_COUNT%).', '', '', 'Disallow', '2003-07-29 19:11:37', '2003-07-30 00:11:41'),
(50, 'Recent Airfield Analysis Results', 'An independent analysis of military airfields controlled by the major combatants indicate that %1ST_COUNTRY% now controls %1ST_PERCENT%% of the airfields (%1ST_COUNT% total), followed by %2ND_COUNTRY% with %2ND_PERCENT%% (%2ND_COUNT%) and %3RD_COUNTRY% with %3RD_PERCENT%% (%3RD_COUNT%).', '', '', 'Disallow', '2003-07-29 19:13:02', '2003-07-30 00:13:02'),
(51, '%VARIETY1% %CON_CITY%', '%VARIETY1% %CON_CITY%', 'TITANIC STRUGGLE FOR; EPIC STRUGGLE FOR; EPIC CLASH FOR; STREET FIGHTING IN; HOUSE TO HOUSE BATTLE IN; ATTACK AT; %ENEMY_SIDE% FOOTHOLD IN; %ENEMY_SIDE% FORCES SURGE INTO', '', 'Disallow', '2003-07-29 19:39:05', '2003-08-08 04:26:10'),
(52, '%CITY% %VARIETY1%', '%CITY% %VARIETY1%', 'UNDER SIEGE; BESIEGED; SURROUNDED; POCKET FORMS', '', 'Disallow', '2003-07-29 19:40:53', '2003-07-30 00:42:06'),
(53, '%PLAYER% Helps Capture %CAPTURED%', '%PLAYER% was recently recognized by %COUNTRY_ADJ% military officials by outstanding performance. %PLAYER% was <i>%RTB%</i> after completion of the mission.<br><br>\r\n\r\nDuring a harrowing %DURATION% minute mission, %PLAYER% showed courage and determination in securing the facility. Men like %PLAYER% are an example to all of us and we salute his bravery. %VARIETY1%.', 'There are reports of a parade near %CAPTURED% in %PLAYER%''s name; This amazing effort by %PLAYER% does not go un-noticed; %ENEMY_COUNTRY% will no doubt feel the loss of %CAPTURED%', '', 'Disallow', '2003-07-29 20:03:07', '2003-08-08 04:18:33'),
(54, '%PLAYER%''s Recent Effort Stands Out', '%PLAYER% was recently recognized by %COUNTRY_ADJ% military officials after an outstanding performance in a mission against the enemy. That mission resulted in <i>%RTB%</i>.<br><br>\r\n\r\nDuring this mission, %PLAYER% had %KILLS% kills and hit %ENEMY_COUNTRY_ADJ% forces at least %HITS% times. This mission lasted %DURATION% minutes.<br><br>\r\n\r\n%VARIETY1%.', '%COUNTRY% is honored by %PLAYER%''s valiant effort; This noble effort by %PLAYER% will not go un-noticed; %COUNTRY% is eternally grateful for %PLAYER%''s sacrifice; While %COUNTRY% recognizes %PLAYER%, %ENEMY_SIDE% leaders have also taken careful note', '', 'Disallow', '2003-07-29 20:09:22', '2003-08-08 04:22:25'),
(55, '%VEHICLE_SHORT% Production Limited', 'In order to focus on other %VARIETY1% weapon types, %COUNTRY% has announced a %PERCENTAGE_DECREASE%% decrease on %VEHICLE% production lines. The directive is expected to take effect by the end of this production cycle. Sources were unsure if the decrease would make room for more modern %CLASS% class units or if the additional resources would be used to fill other equipment needs within alternative branches of the %COUNTRY% military.', 'more modern; newer; more up to date; recently researched; more deadly; more effective; higher demand', '', 'Disallow', '2003-08-01 16:04:54', '2004-03-21 09:19:31'),
(56, '%PLAYER% Promoted To %RANK%', 'Among other promotions handed out on %MONTH% %DAY_ORD%, %PLAYER% was promoted to the rank of %RANK% in the %COUNTRY_ADJ% %RANK_BRANCH%. This %SIGNIFICANCE% promotion was celebrated by %PLAYER%''s comrades near the frontline city %FRONT_CITY% as an unnamed senior officer announced the promotion at %MILITARY_HOURS% hours during a break in the fighting.', '', '', 'Disallow', '2003-08-04 19:06:18', '2003-08-17 00:27:04'),
(57, 'Player Stat Email', '<html>\r\n<head>\r\n<title>Untitled Document</title>\r\n<meta http-equiv="Content-Type" content="text/html; charset=iso-8859-1">\r\n</head>\r\n\r\n<body>\r\n<table width="525" border="0" cellspacing="0" cellpadding="8">\r\n  <tr align="left" valign="top"> \r\n    <td><font face="Arial, Helvetica, sans-serif" size="2" color="#000000"><b>Congratulations! \r\n      The following story is slated to run in the World@War Gazette- the official \r\n      publication of <a href="http://www.wwiionline.com"><font color="#000000">World War II Online</font></a>.</b></font></td>\r\n  </tr>\r\n</table>\r\n<br>\r\n<table width="525" border="1" cellspacing="0" cellpadding="0" bgcolor="#CCCCCC" bordercolor="#999999">\r\n  <tr> \r\n    <td valign=top height="408"> \r\n      <p align="center"><b><font size="6"><font face="Verdana, Arial, Helvetica, sans-serif"><b><font face="Times New Roman, Times, serif" color="#666666">WORLD</font></b><font face="Times New Roman, Times, serif" color="#666666">@<b>WAR</b></font></font></font><font face="Arial, Helvetica, sans-serif" size="6"> \r\n        </font></b></p>\r\n      <table width="100%" border="0" cellspacing="0" cellpadding="5">\r\n        <tr align="left" valign="top"> \r\n          <td> \r\n            <div align="center"><b><font face="Arial, Helvetica, sans-serif" size="6">%TITLE%</font></b></div>\r\n          </td>\r\n        </tr>\r\n      </table><br>\r\n      <table width="100%" border="0" cellspacing="0" cellpadding="10">\r\n        <tr align="left" valign="top"> \r\n          <td>\r\n            <p align="justify"><font face="Times New Roman, Times, serif" size="2">%BODY%</font> \r\n            </p>\r\n          </td>\r\n        </tr>\r\n      </table>\r\n       <table width="100%" border="0" cellspacing="0" cellpadding="0">\r\n        <tr align="left" valign="top"> \r\n          <td width="33%" height="179"> \r\n            <table width="100%" border="0" cellspacing="0" cellpadding="7">\r\n              <tr align="left" valign="top"> \r\n                <td><font face="Arial, Helvetica, sans-serif" size="3"><b>Training \r\n                  Shown As Key to Success</b></font><br>\r\n                  <font face="Times New Roman, Times, serif" size="2">In an interview \r\n                  with command staff at headquarters, it was revealed that the \r\n                  key to battlefield success has been shown through on-going training \r\n                  at all levels. Soldiers, Seamen and Airmen should report to \r\n                  the <a href="http://www.training.wwiionline.com"><font color="#000000">Training \r\n                  Corps</font></a> today.</font></td>\r\n              </tr>\r\n            </table>\r\n            \r\n          </td>\r\n          <td width=1 bgcolor="#000000" height="179"><img width=1></td>\r\n          <td height="179"> \r\n            <table width="100%" border="0" cellspacing="0" cellpadding="7">\r\n              <tr align="left" valign="top"> \r\n                <td><font face="Arial, Helvetica, sans-serif" size="3"><b>Saving \r\n                  Money Part of Wartime Effort Too</b></font><br>\r\n                  <font face="Times New Roman, Times, serif" size="2">Saving money \r\n                  is one more way to conserve resources that can be used to aid \r\n                  our fighting men and women to ensure victory over the enemy. \r\n                  <a href="http://support.playnet.com/support/faq.psp?action=do_faq&fid=210"><font color="#000000">Visit \r\n                  the FAQ page</font></a> today for news about the prepay plan \r\n                  and save money. Victory is our destiny!</font></td>\r\n              </tr>\r\n            </table>\r\n          </td>\r\n          <td width=1 bgcolor="#000000" height="179"><img width=1></td>\r\n          <td width="32%" height="179"> \r\n            <table width="100%" border="0" cellspacing="0" cellpadding="7">\r\n              <tr align="left" valign="top"> \r\n                <td><font face="Arial, Helvetica, sans-serif" size="3"><b>Everyone \r\n                  Wins With Recruitment</b></font><br>\r\n                  <font face="Times New Roman, Times, serif" size="2">It is vital \r\n                  to the war effort to bring in fresh recruits to the battlefield. \r\n                  It helps bolster the war effort and can pay off for you too. \r\n                  Earn free playtime just by recruiting new players. <a href="http://www5.playnet.com/bv/wwiiol/recruitment.jsp"><font color="#000000">Visit \r\n                  the Recruitment Rewards</font></a> page today for details.</font></td>\r\n              </tr>\r\n            </table>\r\n          </td>\r\n        </tr>\r\n      </table>\r\n      <div align="center"> </div>\r\n    </td>\r\n  </tr>\r\n</table>\r\n<br>\r\n<table width="525" border="0" cellspacing="0" cellpadding="8">\r\n  <tr align="left" valign="top"> \r\n    <td>\r\n      <p align="center"><font face="Arial, Helvetica, sans-serif" size="2" color="#000000">This \r\n        is an automated e-mail. Please do not reply.</font></p>\r\n      <p align="center"><font face="Arial, Helvetica, sans-serif" size="1">© Playnet, \r\n        Inc. All Rights Reserved.<br>\r\n        Playnet Inc., World War II Online™ , WWII Online™ Cornered Rat Software®, \r\n        Unity 3D Engine™ are trademarks of Playnet Incorporated.</font></p>\r\n    </td>\r\n  </tr>\r\n</table>\r\n<p>&nbsp;</p>\r\n<p>&nbsp;</p>\r\n<p>&nbsp;</p>\r\n</body>\r\n</html>\r\n', '', '', '', '2003-08-07 10:58:22', '2003-08-07 15:58:22'),
(58, '%1ST_COUNTRY% Controls The Skies', '%1ST_COUNTRY% now owns %1ST_PERCENT%% of the airfields in the European Theatre of Operations. With this decided advantage, forward air units are now able to wreak havoc on enemy factories and front line positions.', '', '', 'Disallow', '2003-08-07 21:49:55', '2003-08-08 02:49:55'),
(59, '%OFFENSIVE_COUNTRY% Marches Forward!', 'Successes all along the front lines were felt by enemy forces as %OFFENSIVE_COUNTRY_ADJ% air, armor and \r\ninfantry units punched holes through front line positions. %OFFENSIVE_COUNTRY_ADJ% population centers eager for victory cheered as the news spread across the country.', '', '', 'Disallow', '2003-08-07 21:58:19', '2003-08-08 02:58:19'),
(60, '%COUNTRY_ADJ% FORCES FALL BACK', '%COUNTRY_ADJ% FORCES FALL BACK', '', '', 'Disallow', '2003-08-07 22:00:11', '2003-08-08 03:00:11'),
