(64, '%PLAYER% Elevated To %RANK%', 'After recent success on the front, %COUNTRY_ADJ% %RANK_BRANCH% officials have have noticed %PLAYER%''s command presence among the troops. As a result, he has been promoted to the rank of %RANK% in the %COUNTRY_ADJ% %RANK_BRANCH%. %PLAYER%''s initiative and prowess in combat are an example for all young officers to follow. ', '', '', 'Disallow', '2003-08-07 22:16:41', '2003-08-08 03:16:41'),
