(88, '%VEHICLE% Production Cut Back', 'Due to %VARIETY1% to %VEHICLE% production of existing models has been cut back this cycle. A %PERCENTAGE_DECREASE%% decrease has been issued to all %VEHICLE% production facilities while tooling up for newer weapons takes place. "We are preparing to send improved weapons to the front to guarrentee victory" said one %COUNTRY_ADJ% official at %FACTORY_CITY% when pressed for comment on the continuing %VARIETY2% being applied to the war effort.', 'planned upgrades; losses at the front; demand for superior firepower', 'strategic plans; weapons production; new weapons research', 'Disallow', '2004-03-16 17:42:10', '2004-03-19 20:58:25'),
(89, 'Production of %VEHICLE% on the Rise.', 'According to the %COUNTRY_ADJ% %VARIETY2%, production of the %VEHICLE% is being increased %PERCENTAGE_INCREASE%% this cycle. %FACTORY_CITY%''s factory facilities have %VARIETY1% which is creating this increased production capacity. More %VEHICLE% units should be arriving at the front by the end of this production cycle as a result of the increase in line production outputs.', 'retooled their production lines;\r\nimproved production techniques; increased their %VEHICLE% budget', 'High Command;\r\nHead of Manufacturing', 'Disallow', '2004-03-17 12:32:45', '2004-04-26 19:11:07'),
(90, 'Heroic effort by %PLAYER% in Battle !', '%COUNTRY_ADJ% military command officials recognized %PLAYER% for heroic actions on the battlefield today %MONTH% %DAY_ORD%. %PLAYER% %VARIETY1% %KILLS% enemy units and battled valiantly during %DURATION% minutes of intense frontline action. At the time of writing he was listed as <i>%RTB%</i>.', 'out fought and scored kills on; killed; thwarted and killed', '', 'Disallow', '2004-03-17 12:42:08', '2004-03-19 20:39:27'),
(91, 'Frontlines to see the %VEHICLE_SHORT% in Action !', '%COUNTRY_ADJ% frontline units are soon to be pitting the first production runs of the %VEHICLE% in action against the enemy. %BRANCH% High Command visiting %FACTORY_CITY% to view production progress of the %VEHICLE% were said to be %VARIETY1% that battle weary %BRANCH% units hard pressed in the ongoing war would soon be able to press home a %VARIETY2% after the new %VEHICLE_SHORT% reaches the frontlines.', 'eagerly anticipating; expecting; impressed\r\n', 'superior advantage; much increased combat flexibilty; greater mobility of firepower', 'Disallow', '2004-03-17 13:00:19', '2004-03-21 10:49:36'),
