(93, '%VEHICLE% Removed from %COUNTRY% Frontline Service.', '%COUNTRY_ADJ% High Command today announced the withdrawal of the %VEHICLE% from active frontline duty. With newer and more %VARIETY1% weapons starting to fill out frontline unit formations and the %VEHICLE_SHORT% becoming ineffective against the newer combat weapons of enemy forces in the field, greater reliance is now being placed on newer combat designs currently in production at %FACTORY_CITY% and soon to be introduced to the war.', 'capable; deadly; modern', '', 'Disallow', '2004-03-17 13:20:45', '2004-03-17 19:20:45'),
(94, '%VEHICLE% Dissappearing from the %COUNTRY% Front.', 'The %VEHICLE% is a %VARIETY1% sight around the battlefield recently. Rumours circulated that %COUNTRY_ADJ% High Command is reducing the number of %VEHICLE% units in anticipation of phasing the %VEHICLE_SHORT% out of production completely. Recent activity around %FACTORY_CITY% is said to be in preparation for newer %VARIETY2% class weapons to start replacing the older %VEHICLE_SHORT% as a frontline combat unit, as the war winds up to an increasing deadly pitch with newer weapons on both sides.\r\n', 'rare; less common; less prevalent', '%CLASS%', 'Disallow', '2004-03-17 13:31:00', '2004-03-31 23:14:30'),
(95, '%COUNTRY_ADJ% prepares %VEHICLE% for Frontline Duty.', 'High Command representitives of the %COUNTRY_ADJ% %BRANCH% speaking from %FACTORY_CITY% .. there to inspect progress of the new %VEHICLE% were quoted as saying production of the %VEHICLE% should be taking precedence over other weapons which will probably be scaled back in an effort to increase battlefield effectiveness of their units at the front. Frontline %BRANCH% units %VARIETY1% the arrival of %VARIETY2% for the extra fighting edge it will offer them in the war effort all along the front.', 'eagerly await; are anticipating; look forward to', 'the new equipment; superior combat performance; this new combat flexibilty', 'Disallow', '2004-03-19 00:40:38', '2004-03-22 02:14:15'),
(96, '%COUNTRY_ADJ% to bring %VEHICLE% into Action', '%COUNTRY_ADJ% %BRANCH% High Command speaking from %FACTORY_CITY% .. where production progress of the %VEHICLE% was said to be %VARIETY1% .. report that when the new weapons reach frontline units we should see a possible shift in the balance of power on the battlefield. Morale amongst %BRANCH% personel in the field is said to be %VARIETY2% for the fight ahead.', 'going well; running three shifts around the clock; gaining impetus\r\n', 'rising fast in anticipation; steadily setting itself; strengthening\r\n', 'Disallow', '2004-03-19 09:34:54', '2004-03-19 15:34:54'),
(97, '%ENEMY_SIDE% Break Through %COUNTRY_ADJ% Lines', '%ENEMY_SIDE% %CLASS% units %VARIETY1% the %DISTANCE% mile %COUNTRY_ADJ% frontlines last night. %ENEMY_SIDE% %CLASS% inflitrated several towns as the two sides clashed in bitter engagements in several key breaches in %SIDE% lines. Reports of %VARIETY2% %CLASS% reinforcements pouring through the breaks in the line of %COUNTRY_ADJ% defenses filtered back from all combat zones currently experiencing high levels of enemy activity.', 'broke through; breached; smashed their way through', 'enemy; friendly; fresh; strengthened\r\n', 'Disallow', '2004-03-19 09:59:12', '2004-03-19 17:09:30'),
