(101, 'Fighting Spirit Shown by %PLAYER%', 'Word came back from the %VARIETY1% that %PLAYER% killed %KILLS% %ENEMY_COUNTRY_ADJ% units in a combat mission that lasted %DURATION% minutes. After outsmarting and eliminating his opponents in a desperate battle he was posted as <i>%RTB%</i> <br><br> These are the kinds of inspirational feats on the field of battle that spur our boys on to victory !', 'frontline today; battlefield last night', '', 'Disallow', '2004-03-19 10:18:15', '2004-03-19 16:18:15'),
(102, 'Great Flying by %PLAYER%<br>in Deadly Aerial Battle', 'In an air battle lasting up to %DURATION% minutes %PLAYER% killed %KILLS% %ENEMY_COUNTRY_ADJ% units while on patrol over the frontlines. Ater this harrowing %VARIETY1% he was posted as <i>%RTB%</i> <br><br>\r\nOfficials of the %COUNTRY_ADJ% Air Force Command said today that this kind of determination and sacrifice remains an example to all pilots flying above their brothers on the battlefield.', 'combat sortie; combat air patrol; aerial battle', '', 'Disallow', '2004-03-19 10:25:21', '2004-03-22 03:32:55'),
