(104, 'Western Europe In Flames !', 'Word from officials in the %COUNTRY_ADJ% controlled town of %CITY%, contained in a new intelligence report, shows that %1ST_COUNTRY% now controls %1ST_PERCENT%% of the Western European Theatre of operations. %2ND_COUNTRY% owns %2ND_PERCENT%% and %3RD_COUNTRY% owns %3RD_PERCENT%%. The battle for control of the continent continues to descend into a fury of fire and hell.', '', '', 'Disallow', '2004-03-19 10:48:22', '2004-03-19 16:48:22'),
(105, '%OFFENSIVE_COUNTRY% Push Ahead !', '%OFFENSIVE_COUNTRY_ADJ% forces pushing further and further into the enemies lines %VARIETY1%. %OFFENSIVE_SIDE% %VARIETY2% are increasing the pressure on enemy defenses all across the front lines.\r\n<br><br>\r\nSoldiers, airmen, tankers and naval personel from all branches are showing a commitment and willingness to do what needs to be done that is seeing the war reach its crescendo of destruction in the quest for victory.', 'of defense; and forcing them back; forcing them to withdraw desperately', 'units; forces; combat veterans', 'Disallow', '2004-03-19 10:56:34', '2004-03-19 16:56:34'),
(106, 'Herculean effort by %PLAYER%<br> in Clash of Armour!', 'In an %VARIETY1% lasting up to %DURATION% minutes %PLAYER% engaged at least %KILLS% %ENEMY_COUNTRY_ADJ% units while moving through the frontlines. During this this harrowing %VARIETY2% %PLAYER% killed %KILLS% and reports afterwards say he was posted as <i>%RTB%</i> <br><br>\r\nOfficials of the %COUNTRY_ADJ% Armoured Command said today that this kind of heroic effort and skilled combat remains an example to all soldiers on the battlefield as they steel their esolve to move forwards to victory.', 'armoured engagement; tank battle; clash of machines', 'mission; battle of iron beasts; tank versus tank confrontation', 'Disallow', '2004-03-19 12:16:59', '2004-03-22 03:34:19'),
(107, '%PLAYER% Displays True Soldier Courage!', 'During %VARIETY1% lasting up to %DURATION% minutes %PLAYER% fought and killed at least %KILLS% %ENEMY_COUNTRY_ADJ% units while holding ground during an intense assault.<br><br>\r\nDuring this harrowing %VARIETY2% %PLAYER% displayed true courage and posession of a pair of big ones. Mission reports after the battle say he was posted as <i>%RTB%</i>', 'an infantry engagement; a deadly gun battle; a squad level action', 'mission; deadly skirmish; bullet riddled battle', 'Disallow', '2004-03-19 12:38:55', '2004-03-19 20:46:26'),
