(110, '%COUNTRY_ADJ% Factories in Dire Straights', '%VARIETY1% of %INTENSITY% attack by enemy bombers has caused %COUNTRY_ADJ% %VARIETY2%  in the %FACTORY_CITY% region to fall behind in production output. Despite continuous efforts by %COUNTRY_ADJ% Air Force units to help protect the important %VARIETY2% in %FACTORY_CITY%, the damage has taken its toll, dropping factory output to %FACTORY_OUTPUT%% of total capacity. This is causing severe consequences for all units running low on equipment and facing the newer weapons that their %ENEMY_SIDE% adversaries are beginning to field in numbers at the front.\r\n', 'Recent days; Recent nights', 'factories; RD&P facilities; production complexes', '', '2004-03-19 13:07:00', '2004-03-19 19:07:00'),
(111, '%FACTORY_CITY% RD&P Facilities %VARIETY1%', 'The latest %INTENSITY% attacks by %ENEMY_SIDE% bomber formations over %FACTORY_CITY% has caused %VARIETY2% output to drop to %FACTORY_OUTPUT%% at that city.\r\n', 'Bombed; Under Air Attack; Hit by Bombs; Struck by Bombs; Pounded from the Air; Damaged by Continuous Bombing', 'RD%P; Production; Research of new weapons\r\n', 'Disallow', '2004-03-19 14:52:56', '2004-03-19 20:52:56'),
(112, '%COUNTRY% Alters Production Priorities.', '%COUNTRY_ADJ% %BRANCH% High Command Officials announced today that several %CLASS% class combat units will get %VEHICLE% units in greater numbers by the end of this cycle. Fighting near %FRONT_CITY% has slowed enough to allow %VARIETY1% of these units to the front. Opposing %ENEMY_SIDE% forces were expected to meet this %VARIETY2% in the coming RD&P cycles, but the %INCREASE_ADJ% increase will be a welcome addition to the %COUNTRY_ADJ% %BRANCH% front line forces.', 'movement; transport; convoy; shipment', 'move; development; change in enemy initiatives', 'Disallow', '2004-03-19 15:46:06', '2004-04-26 19:13:32'),
(113, '%OFFENSIVE_COUNTRY% Tightens Grip on Frontlines', '%OFFENSIVE_COUNTRY_ADJ% forces are %VARIETY1% the frontlines throughout all combat zones of Western Europe. %OFFENSIVE_SIDE% assaults are %VARIETY2% in several locations across the combat front.\r\n<br><br>\r\nThe war is rising in pitch to become a meatgrinder of death and destruction and the support of all in the pursuit of victory is becoming increasingly urgent everywhere.', 'closing their fist around; moving to crush; mounting deadly assaults on', 'breaking through the lines; pushing the enemy back; crushing enemy resistance; smashing the defenses', 'Disallow', '2004-03-21 03:32:20', '2004-03-21 09:32:20');
