(117, '%COUNTRY% Shifts Production Focus.', '%COUNTRY_ADJ% has shifted priorities this production cycle by improving cost efficiency of the %VARIETY1% production lines. The savings in resources that this brings will now be able to be %VARIETY2% other weapons production which will increase the numbers of weapons our armed forces can deploy in the field and allow us to more easily attrit the the enemies units and overwhelm them with superior numbers.', '%VEHICLE%', 'diverted to; put towards; spent on', 'Disallow', '2004-04-26 14:25:57', '2004-04-26 19:25:57'),
(118, '%PLAYER% Helps Blunt Armoured Advance!', 'On %START%, %PLAYER% began his mission from %SPAWN% in a %VEHICLE% anti-tank gun.<br>\r\n<br>\r\nIn the %DURATION% minute effort, he effectively positioned his gun destroying %LIST%. <br>\r\n<br>\r\n%ENEMY_SIDE% armor forces will think twice about taking on the skilled defense forces of %COUNTRY%.', '', '', 'Disallow', '2004-10-22 19:52:29', '2004-10-24 00:05:28'),
(119, '%PLAYER% Attacks From The Skies!', 'After taking off from %SPAWN%, %PLAYER% flew his %VEHICLE% to the front for ground attack duty.\r\n\r\nDuring his %DURATION% minute flight, he destroyed %LIST% for a total of %TARGET_KILLS% kills.\r\n\r\nThe mission after action report list him as <i>%RTB%</i>.', '', '', 'Disallow', '2004-10-23 19:21:56', '2004-10-24 00:21:56'),
(120, '%ENEMY_SIDE%''s Tanks Ambushed Near %SPAWN%', 'Under cover of brush, %COUNTRY_ADJ% special missions troops waited in ambush near the frontline town of %SPAWN%.<br>\r\n<br>\r\nAs the %SIDE_ADJ% armor approached, one soldier in particular displayed exceptional marksmanship destroying %TARGET_KILLS% enemy units including %LIST%.<br>\r\n<br>\r\nFellow servicemen honored %PLAYER%''s %DURATION% minute effort with a round of drinks back at base after the action died down.<br>\r\n<br>\r\nHe was listed as %RTB% in the post mission debrief.', '', '', 'Disallow', '2004-10-23 19:31:28', '2004-11-19 16:20:01'),
(121, 'Combat Engineers, A Tough Breed', 'AARS from the field hilight the role combat engineers are playing to help defeat the %ENEMY_SIDE% forces.<br>\r\n<br>\r\n%COUNTRY_ADJ% Sapper %PLAYER% describes his latest mission, "I used cover as best I could, attacking tanks from behind and lobbing grenades at trucks and troops. My commanding officer confirmed I killed %LIST% in %DURATION% minutes."<br>\r\n<br>\r\nWith fighting men like this, %SIDE% forces are assured victory!\r\n', '', '', 'Disallow', '2004-10-23 19:42:21', '2004-10-24 00:42:21');
